import React from 'react';

class ListItem extends React.Component {
  constructor (props) {
    super(props);
    this.state = {
      isCompleted: false
    }
  }
  render() {
    isCompleted ? listStyle = {textDecoration: "line-through"} : lineStyle = {textDecoration: "none"};
    return (
      <li>{this.props.item}<button  onClick={this.props.removeItem}>Delete</button></li>
    )
  }
}

export default ListItem;
